    false,nt"url": null,nt"notes": "This dataset includes 8 georeferenced images,
    acquired on May 5th, 6th and 26th, 1957 over portions of Marais des Cygnes National
    Refuge in eastern Kansas.  This data set is a georeferenced version of an original
    black and white aerial photograph downloaded from Earth Explorer (USGS). The original
    photos were georeferenced against the Linn County 2012 NAIP images. This data set
    provides a look back in time at land conditions along a stretch of the Marias des
    Cygnes River which is now part of the refuge. These images (at a resolution of 0.45
    meters) allows a very detailed look at habitats including areas that were cropped,
    native prairie, and woodlands at that time. Change over time estimates can be made
    from this image using current imagery for comparison. This image, and others from
    1950, and 1938, is being used by refuge staff to assist in understanding and visualizing
    the historical content of the lands within the refuge and how they have changed
    over the last 50 years. Pixel resolution of this image is  0.45 meters. This image
    should be used for resource-level interpretation only.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
